import React from 'react'
//Не забываем импортировать компонент
import Card from './Card';
import av1 from "../compon"

class CardList extends React.Component {
    render() {
        return (
            <React.Fragment>
                <Card
                    title="Зимние ботинки"
                    price={99}
                    description="Такие только у нас"
                    imgLink={av1}
                />
                <Card
                    title="Пляжные тапки"
                    price={23}
                    description="Надеюсь, пригодятся"
                    imgLink="week23\my-app1\assets\images\captaim america.jpg"
                />
                <Card
                    title="Праздничные туфли"
                    price={85}
                    description="Теперь и в чёрном цвете"
                    imgLink="week23\my-app1\assets\images\superman.png"
                />
            </React.Fragment>
        );
    }
}

export default CardList;
